import React from 'react';
import { TextInput } from 'react-native';

function SearchInput() {
	return (
		<TextInput
			style={{ direction: 'rtl', borderWidth: 2, borderColor: 'red', flex: 1 }}
			placeholder="جستجو از میان هزاران کالا"
		/>
	);
}

export default SearchInput;
